import { mapGetters } from "vuex";
import PanThumb from "@/components/PanThumb";
import Mallki from "@/components/TextHoverEffect/Mallki";
import { getTimeDate } from "@/utils/index.js";

export default {
  components: { PanThumb, Mallki },

  filters: {
    statusFilter(status) {
      const statusMap = {
        success: "success",
        pending: "danger"
      };
      return statusMap[status];
    }
  },
  data() {
    return {
      statisticsData: {
        article_count: 1024,
        pageviews_count: 1024
      }
    };
  },
  computed: {
    ...mapGetters(["avatar", "roles"]),
    ...mapGetters(["name"]),
    ...mapGetters(["userinfo"]),
    getLastlogintime() {
      return getTimeDate(this.$store.state.userinfo.dbUpdateSysTime);
    },
    getBusinessStatus() {
      let userinfo = this.$store.state.userinfo;
      switch (userinfo.businessStatusId) {
        case "1":
          return "待完善资料";
          break;
        case "2":
          return "待审核";
          break;
        case "3":
          return "审核中";
          break;
        case "4":
          return "审核通过";
          break;
        case "5":
          return "审核失败";
          break;
        default:
          return "正在获取....";
          break;
      }
    },
    getFoomdisabled() {
      let userinfo = this.$store.state.userinfo;
      return userinfo.businessStatusId == 4 || userinfo.businessStatusId == 6;
    }
  }
};
